    public static final String FUNC_CHANGETOKENADDRESS = "changeTokenAddress";

    public static final String FUNC_CHECKTOKEN = "checkToken";

    public static final String FUNC_CHANGEMAPPING = "changeMapping";

    public static final String FUNC_CREATCONTRACT = "creatContract";


    protected IBFactoryContract(String contractAddress, Web3j web3j, Credentials credentials, BigInteger gasPrice, BigInteger gasLimit) {
        super(BINARY, contractAddress, web3j, credentials, gasPrice, gasLimit);
    }


    protected IBFactoryContract(String contractAddress, Web3j web3j, TransactionManager transactionManager, BigInteger gasPrice, BigInteger gasLimit) {
        super(BINARY, contractAddress, web3j, transactionManager, gasPrice, gasLimit);
    }


    public RemoteCall<TransactionReceipt> changeTokenAddress(BigInteger num, String addr) {
        final Function function = new Function(
                FUNC_CHANGETOKENADDRESS, 
                Arrays.<Type>asList(new org.web3j.abi.datatypes.generated.Uint256(num), 
                new Address(addr)),
                Collections.<TypeReference<?>>emptyList());
        return executeRemoteCallTransaction(function);
    }

    public RemoteCall<String> checkToken(BigInteger num) {
        final Function function = new Function(FUNC_CHECKTOKEN,
                Arrays.<Type>asList(new org.web3j.abi.datatypes.generated.Uint256(num)),
                Arrays.<TypeReference<?>>asList(new TypeReference<Address>() {}));
        return executeRemoteCallSingleValueReturn(function, String.class);
    }

    public RemoteCall<TransactionReceipt> changeMapping(String map) {
        final Function function = new Function(
                FUNC_CHANGEMAPPING,
                Arrays.<Type>asList(new Address(map)),
                Collections.<TypeReference<?>>emptyList());
        return executeRemoteCallTransaction(function);
    }

    public RemoteCall<TransactionReceipt> creatContract(BigInteger borrowerAmount, BigInteger lenderAmount, BigInteger tokenId, BigInteger limitdays, BigInteger interestRate) {
        final Function function = new Function(
                FUNC_CREATCONTRACT,
                Arrays.<Type>asList(new org.web3j.abi.datatypes.generated.Uint256(borrowerAmount),
                new org.web3j.abi.datatypes.generated.Uint256(lenderAmount),
                new org.web3j.abi.datatypes.generated.Uint256(tokenId),
                new org.web3j.abi.datatypes.generated.Uint256(limitdays),
                new org.web3j.abi.datatypes.generated.Uint256(interestRate)),
                Collections.<TypeReference<?>>emptyList());
        return executeRemoteCallTransaction(function);
    }



